CREATE TABLE departments (
  dept_id SERIAL PRIMARY KEY,
  name VARCHAR(80) NOT NULL UNIQUE,
  floor INTEGER NOT NULL CHECK (floor > 0),
  extension VARCHAR(10) UNIQUE,
  created_at DATE NOT NULL DEFAULT CURRENT_DATE
);

CREATE TABLE doctors (
  doctor_id SERIAL PRIMARY KEY,
  name VARCHAR(100) NOT NULL,
  email VARCHAR(150) NOT NULL UNIQUE,
  dept_id INTEGER NOT NULL REFERENCES departments(dept_id) ON DELETE RESTRICT,
  salary NUMERIC(12,2) NOT NULL CHECK (salary > 0)
);

CREATE TABLE patients (
  patient_id SERIAL PRIMARY KEY,
  name VARCHAR(120) NOT NULL,
  dob DATE NOT NULL CHECK (dob <= CURRENT_DATE),
  phone VARCHAR(15) NOT NULL UNIQUE CHECK (char_length(phone) = 10),
  blood_group VARCHAR(5) CHECK (blood_group IN ('A+','A-','B+','B-','AB+','AB-','O+','O-'))
);

CREATE TABLE appointments (
  appointment_id SERIAL PRIMARY KEY,
  patient_id INTEGER NOT NULL REFERENCES patients(patient_id) ON DELETE CASCADE,
  doctor_id INTEGER NOT NULL REFERENCES doctors(doctor_id) ON DELETE SET NULL,
  appt_datetime TIMESTAMP NOT NULL CHECK (appt_datetime >= DATE '2000-01-01'),
  status VARCHAR(20) NOT NULL CHECK (status IN ('Scheduled','Completed','Cancelled','No-show'))
);

CREATE TABLE prescriptions (
  prescription_id SERIAL PRIMARY KEY,
  appointment_id INTEGER NOT NULL REFERENCES appointments(appointment_id) ON DELETE CASCADE,
  medicine VARCHAR(200) NOT NULL,
  dose VARCHAR(80) NOT NULL,
  duration_days INTEGER NOT NULL CHECK (duration_days > 0)
);

CREATE TABLE payments (
  payment_id SERIAL PRIMARY KEY,
  appointment_id INTEGER NOT NULL REFERENCES appointments(appointment_id) ON DELETE CASCADE,
  amount NUMERIC(12,2) NOT NULL CHECK (amount >= 0),
  method VARCHAR(20) NOT NULL CHECK (method IN ('Cash','Card','Insurance','Online')),
  paid BOOLEAN NOT NULL DEFAULT FALSE
);







